import site1 from "../images/sites/site1.jpg";
import site2 from "../images/sites/site2.jpg";
import site3 from "../images/sites/site3.png";
import site4 from "../images/sites/site4.png";
import Container from "react-bootstrap/Container";

function Portfolio(props) {
  return (
    <Container>
      <ul className="Portfolio-sites">
        {props.sites.map(site => (
          <li key={site}>
            <a href="http://localhost:8888/Beauty/" target="_blank">
              {site.name}
              <img src={site.img} alt="" />
            </a>
          </li>
        ))}
        <style jsx>{`
          .Portfolio-sites {
            list-style-type: none;
            display: flex;
            flex-wrap: wrap;
            //   max-width: 900px;
            justify-content: center;
            margin: 60px auto 0px;
            padding: 40px;
            font-size: 1.5rem;
          }
          li {
            flex-basis: 33%;
            padding: 20px 0px;
          }

          li a {
            color: #000;
            text-decoration: none;
          }
        `}</style>
      </ul>
    </Container>
  );
}

Portfolio.defaultProps = {
  sites: [
    { name: "Beauty Site", img: site1 },
    { name: "Cosmetics Site", img: site2 },
    { name: "Restaurant Site", img: site3 },
    { name: "Sports Site", img: site1 },
    { name: "Music Site", img: site1 },
    { name: "Legal Site", img: site1 }
  ]
};

export default Portfolio;
